function Button() {
  return (
    <>
      <div className="d-grid gap-2 d-md-flex justify-content-center ">
        <button type="button" className="btn btn-outline-secondary btn-lg" style={{ width: "80%" }}>
          Compaction Test Results
        </button>
      </div>
    </>
  );
}

export default Button;
